import logo from './logo.svg'


function App() {
  return (
    <div className="w-full h-full absolute bg-gradient-to-r from-blue-400 to-emerald-400">
    <header className="flex justify-between items-center text-black py-6 px-8 md: px-32 bg-white drop-shadow-md">
      <a href="#">
        <img src={logo} alt="logo" className="w-52 hover:scale-105 transition-all"/>
      </a>
      <ul className="hidden xl:flex items-center gap-12 font-semibold text-base">
        <li className="p-3 hover:bg-sky-400 hover:text-white rounded-md transition-all cursor-pointer">Home</li>
        <li className="p-3 hover:bg-sky-400 hover:text-white rounded-md transition-all cursor-pointer">Teachers</li>
        <li className="p-3 hover:bg-sky-400 hover:text-white rounded-md transition-all cursor-pointer">Login</li>
        <li className="p-3 hover:bg-sky-400 hover:text-white rounded-md transition-all cursor-pointer">Signup</li>
      </ul>
    </header>
    </div>
  );
}

export default App;
